import React from 'react';
import logo from '../assets/logo.jpeg';
import '../styles/App.css';
import Navbar from "./Navbar";

function App() {
  return (
    <div className="App">
        <Navbar />

        <img src={logo} alt="logo" />
    </div>
  );
}

export default App;
